      const result = await fetch(api_url)
        .then(
          response => response.json()
        )
      setData(result)
      console.log(result, "re")
    }
    fetchData()
  }, [])
  return (
    <div>
      {(data.map)||[]((campaigns) => {
        return (
          <ul>
            <li key={campaigns.id}>{campaigns.name}</li>
          </ul>
        )
      })}
     Good Luck!
    </div>
  );
}

export default App;
